/* double quotation   ""  "  */
void removeEscapeChars(SChar *aStr)
{
    static SChar sEsc = '"';
    SChar *sSrc = NULL;
    SChar *sDst = NULL;

    for(sSrc = sDst = aStr; *sSrc != '\0'; sSrc++)
    {
        if ( *sSrc != sEsc )
        {
            *(sDst++) = *sSrc;
        }
        else
        {
            if ( *(sSrc+1) != '\0' &&
                 *(sSrc+1) == sEsc )
            {
                *(sDst++) = sEsc;
                sSrc++;
            }
            else
            {
                *(sDst++) = *sSrc;
            }
        }
    }
    *sDst = '\0';
}

