char *
ltrim(char *s)
{
   char *p = s;

   while (*p == ' ' && idlOS::strlen(p) > 0)
      p++;

   // BUG-25208[CodeSonar]    
   idlOS::memmove(s, p, (idlOS::strlen(p)+1));

   return s;
}

char *
rtrim(char *s)
{
   char *str;

   str = s + idlOS::strlen(s)-1;
   for (; s<str; str--)
   {
      if (*str == ' ')
         *str = (char) 0;
      else
         break;
   }

   return s;
}

